import React from 'react'
import data from './sectionInfo.json'

const displayTable = () => {
    {data.map(person => {
        return (
            <List.Item block key={section.sectionID}>
                <List.Content>
                    {section.x_min} and {section.x_max}
                </List.Content>
            </List.Item>
        )
    })}
}

export default displayTable
